//   =============== Verify Random Function by ChanLink ===============

import "../DAO/DAOCall.sol";
import "../ERC20/ILOTT.sol";

contract RegisterDAO is DAOCall{

    function LOTT() public view returns(ILOTT){
        address LOTTAddress = abi.decode(DAOGet("LOTT"), (address));
        return ILOTT(LOTTAddress);
    }

    function registerSign(address signer, address presenter, bool pureSign) public {
        ILOTT lott = LOTT();
        if(pureSign) {
            lott.mint(signer, abi.decode(DAOGet("pureSignBonus"), (uint256)));
        } else {
            lott.mint(presenter, abi.decode(DAOGet("normalSignBonus"), (uint256)));
        } if(presenter != address(0)) {
            lott.mint(presenter, abi.decode(DAOGet("presenterBonus"), (uint256)));
        }
    }
}

