/**
 * @dev this is an abstract contract which defines dao contract calls.
 */

abstract contract DAOCall {

    address immutable DAOInit = address(0); // should be filled by an eteranal address

    function DAO() public view returns(address DAOAddr){
        (bool success, bytes memory data) = DAOInit.staticcall(abi.encodeWithSignature("DAO()"));
        if(success) {return abi.decode(data, (address));}
    }

    function DAOGet(string memory varName) public view returns(bytes memory varData) {
        (bool success, bytes memory data) = DAO().staticcall(abi.encodeWithSignature("get(string)", varName));
        if(success) {return data;}
    }

    function DAOCheck(string memory varName, bytes memory varData) public view returns(bool) {
        (bool success, bytes memory data) = DAO().staticcall(abi.encodeWithSignature("check(string, bytes)", varName, varData));
        if(success) {return abi.decode(data, (bool));}
    }

    /**
     * @dev Throws if called by any other address except DAO contract.
     */
    modifier onlyDAO(string memory roll) {
        require(msg.sender == DAO(), "DecentralAccess: restricted access to specific roll");
        _;
    }

    /**
     * @dev Throws if called by any other address except specific roll.
     */
    modifier onlyRoll(string memory roll) {
        require(DAOCheck(roll, abi.encode(msg.sender)), "DecentralAccess: restricted access to specific roll");
        _;
    }
}

