import "../DAO/DAOCall.sol";

contract UserData is DAOCall{

    struct User{
        string username;
        mapping (string => uint256) varsUint;
        mapping (string => address) varsAddress;
        mapping (string => string) varsString;
    }

    mapping(address => User) public addrToUser;
    mapping(string => address) public userToAddr;

    function setAddress(address userAddr, string memory username) public onlyRoll("Register"){
        userToAddr[username] = userAddr;
    }

    function setUsername(address userAddr, string memory username) public onlyRoll("Register") {
        addrToUser[userAddr].username = username;
    }

    function setVars(address userAddr, string memory varName, uint256 varNum) public onlyRoll("Register") {
        addrToUser[userAddr].varsUint[varName] = varNum;
    }

    function setVars(address userAddr, string memory varName, address varAddr) public onlyRoll("Register") {
        addrToUser[userAddr].varsAddress[varName] = varAddr;
    }

    function setVars(address userAddr, string memory varName, string memory varStr) public onlyRoll("Register") {
        addrToUser[userAddr].varsString[varName] = varStr;
    }
}

